  static async getAnalyticsSummary() {
    try {
      const response = await fetch(`${SCHOOLS_API_URL}/api/analytics/summary`);
      const data = await response.json();
      return data.success ? data : { success: false, data: { totals: { users: 0, courses: 0, enrollments: 0 } } };
    } catch (error) {
      console.error('Analytics error:', error);
      return { success: false, data: { totals: { users: 0, courses: 0, enrollments: 0 } } };
    }
  }

  static async searchCourses(query) {
    try {
      const response = await fetch(`${SCHOOLS_API_URL}/api/search/courses?q=${encodeURIComponent(query)}`);
      const data = await response.json();
      return data.success ? { ...data, results: this.ensureArray(data.results) } : { success: false, results: [], count: 0, query };
    } catch (error) {
      console.error('Search error:', error);
      return { success: false, results: [], count: 0, query };
    }
  }

  static async getUsers() {
    try {
      const response = await fetch(`${SCHOOLS_API_URL}/api/users`);
      const data = await response.json();
      return { ...data, data: this.ensureArray(data.data) };
    } catch (error) {
      console.error('Users error:', error);
      return { success: false, data: [], count: 0 };
    }
  }

  static async getUserEnrollments(userId) {
    try {
      const response = await fetch(`${SCHOOLS_API_URL}/api/enrollments`);
      const data = await response.json();
      const allEnrollments = this.ensureArray(data.data);
      const userEnrollments = allEnrollments.filter(e => e.userId === userId);
      return { success: true, data: userEnrollments, count: userEnrollments.length };
    } catch (error) {
      console.error('User enrollments error:', error);
      return { success: false, data: [], count: 0 };
    }
